\boxed{\begin{align*}
\text{Let's say the weight of one treek is } T, \\
\text{the weight of one squig is } S, \\
\text{and the weight of one goolee is } G.
\end{align*}

\begin{align*}
10T &= 3S + G \\
2T + G &= S
\end{align*}

We can solve the second equation for $G$:
\begin{align*}
G &= S - 2T
\end{align*}

Now, substitute $G$ into the first equation:
\begin{align*}
10T &= 3S + (S - 2T) \\
10T &= 4S - 2T \\
12T &= 4S \\
3T &= S
\end{align*}

So, the combined weight of 3 treeks equals the weight of one squig.

\boxed{\begin{align*}
\text{Mike paid } \$1.25 \text{ for the stamp three years ago.}\\
\text{He was just offered double that amount for the stamp.}\\
\text{So, he was offered } \$1.25 \times 2 = \$2.50 \text{ for the stamp.}\\
\text{The offer price doubles every three years.}\\
\text{In 12 more years, the offer price will double 4 times.}\\
\text{So, the offer price will be } \$2.50 \times 2^4 = \$2.50 \times 16 = \$40.}\\
\text{Therefore, Mike will be offered } \$40 \text{ in 12 more years.}
\end{align*}}

\boxed{\begin{align*}
\text{Let } f \text{ be the cost of one pound of feathers, and } g \text{ be the cost of one ounce of gold.}\\
8f + 2g &= 932\\
14f + 3g &= 1402\\
\end{align*}
\begin{align*}
\text{Multiply the first equation by 3 and the second equation by 2:}\\
24f + 6g &= 2796\\
28f + 6g &= 2804\\
\end{align*}
\begin{align*}
\text{Subtract the first equation from the second:}\\
4f &= 8\\
f &= 2\\
\end{align*}
\begin{align*}
\text{Substitute } f = 2 \text{ into the first equation:}\\
8(2) + 2g &= 932\\
16 + 2g &= 932\\
2g &= 916\\
g &= 458\\
\end{align*}
\begin{align*}
\text{Now we know the cost of one pound of feathers is 2 dollars and the cost of one ounce of gold is 458 dollars.}\\
\text{So the cost of five pounds of feathers is 5 * 2 = 10 dollars.}\\
\text{And the cost of five ounces of gold is 5 * 458 = 2290 dollars.}\\
\text{Therefore, the cost of five pounds of feathers and five ounces of gold is 10 + 2290 = 2300 dollars.}\\
\text{The answer is 2300.}

To simplify $(3-i)(6+2i)$, we need to use the distributive property. 

\begin{align*}
(3-i)(6+2i) & = 3(6+2i) - i(6+2i) \\
& = 18 + 6i - 6i - 2i^2 \\
& = 18 - 2i^2
\end{align*}

Since $i^2 = -1$, we can replace $i^2$ with $-1$.

\begin{align*}
18 - 2i^2 & = 18 - 2(-1) \\
& = 18 + 2 \\
& = \boxed{20}
\end{align*}

