To find the minimum value of the quadratic equation $x^2 - 14x + 3$, we need to find the vertex of the parabola it represents. The x-coordinate of the vertex is given by the formula $x = \frac{-b}{2a}$, where $a$ and $b$ are the coefficients of the quadratic equation. In this case, $a = 1$ and $b = -14$. 

So, $x = \frac{-(-14)}{2(1)} = \frac{14}{2} = 7$.

