\boxed{\begin{align*}
2d &= 17e - 8 \\
2e &= d - 9 \\
\end{align*}

We can substitute the second equation into the first equation to get:
\begin{align*}
2(d-9) &= 17e - 8 \\
2d - 18 &= 17e - 8 \\
2d &= 17e + 10 \\
\end{align*}

Now we can substitute the second equation into the first equation to get:
\begin{align*}
2(e+9) &= 17e + 10 \\
2e + 18 &= 17e + 10 \\
18 &= 15e + 10 \\
8 &= 15e \\
\frac{8}{15} &= e \\
\end{align*}

So, $e = \boxed{\frac{8}{15}}$}

\boxed{\begin{align*}
x^2 - (x-2)^2 &= 60\\
x^2 - (x^2 - 4x + 4) &= 60\\
x^2 - x^2 + 4x - 4 &= 60\\
4x - 4 &= 60\\
4x &= 64\\
x &= 16
\end{align*}
Since $x$ is even, the other number is $x-2 = 16-2 = 14$. The sum of the two numbers is $x + (x-2) = 16 + 14 = \boxed{30}$.}

\boxed{\begin{align*}
\frac{a+2b}{2} &= 7\\
\Rightarrow\qquad a+2b &= 14\\
\frac{a+2c}{2} &= 8\\
\Rightarrow\qquad a+2c &= 16\\
\end{align*}
Subtracting the first equation from the second equation, we get
\begin{align*}
(a+2c)-(a+2b) &= 16-14\\
\Rightarrow\qquad 2c-2b &= 2\\
\Rightarrow\qquad c-b &= 1\\
\end{align*}
Now, we can substitute $c = b+1$ into the first equation to get
\begin{align*}
a+2b &= 14\\
\Rightarrow\qquad a+2(b+1) &= 14\\
\Rightarrow\qquad a+2b+2 &= 14\\
\Rightarrow\qquad a+2b &= 12\\
\end{align*}
Now we have two equations and two unknowns. We can solve for $a$ and $b$ by using the two equations:
\begin{align*}
a+2b &= 12\\
c-b &= 1\\
\end{align*}
We can solve the second equation for $c$ to get $c = b+1$. Substituting this into the first equation, we get
\begin{align*}
a+2b &= 12\\
\Rightarrow\qquad a+2(b+1) &= 12\\
\Rightarrow\qquad a+2b+2 &= 12\\
\Rightarrow\qquad a+2b &= 10\\
\end{align*}
Now we have
\begin{align*}
a+2b &= 10\\
a+2c &= 16\\
\end{align*}
Subtracting the first equation from the second equation, we get
\begin{align*}
(a+2c)-(a+2b) &= 16-10\\
\Rightarrow\qquad 2c-2b &= 6\\
\Rightarrow\qquad c-b &= 3\\
\end{align*}
We know that $c = b+1$. Substituting this into the equation $c-b = 3$, we get
\begin{align*}
b+1-b &= 3\\
\Rightarrow\qquad 1 &= 3\\
\end{align*}
This is a contradiction, so there is no solution to the system of equations. Therefore, there is no average of $a$, $b$, and $c$.
\boxed{There is no solution.}

To find $g(3)$, we first need to find the inverse of $f(x)$.

\begin{align*}
y&=\dfrac{x+5}{3}\\
3y&=x+5\\
3y-5&=x\\
x&=3y-5
\end{align*}

So, $f^{-1}(x)=3x-5$.

Now, we can find $g(x)$ by substituting $f^{-1}(x)$ into the equation for $g(x)$.

\begin{align*}
g(x)&=\dfrac{1}{f^{-1}(x)+1}\\
&=\dfrac{1}{(3x-5)+1}\\
&=\dfrac{1}{3x-4}
\end{align*}

Now, we can find $g(3)$ by substituting $x=3$ into the equation for $g(x)$.

\begin{align*}
g(3)&=\dfrac{1}{3(3)-4}\\
&=\dfrac{1}{9-4}\\
&=\dfrac{1}{5}
\end{align*}

