\boxed{\begin{align*}
y&=ax^2+bx+c\\
y&=a(x-p)^2+p\\
y&=a(x^2-2px+p^2)+p\\
y&=ax^2-2apx+ap^2+p\\
\end{align*}
Since the $y$-intercept is $(0,-p)$, we have $c=-p$. Therefore, we have $ap^2+p=-p$.
\begin{align*}
ap^2+p&=-p\\
ap^2&=-2p\\
a&=-2/p\\
\end{align*}
Now we substitute $a=-2/p$ into the equation $y=ax^2-2apx+ap^2+p$.
\begin{align*}
y&=-\frac{2}{p}x^2+4x+p\\
\end{align*}
Since the vertex is $(p,p)$, we have $p=-\frac{2}{p}p^2+4p+p$. 
\begin{align*}
p&=-\frac{2}{p}p^2+4p+p\\
p&=-2p+5p\\
p&=3p\\
\end{align*}
Since $p\neq 0$, we can divide both sides by $p$.
\begin{align*}
1&=3\\
\end{align*}
This is a contradiction. Therefore, the given conditions are inconsistent.

