\boxed{\begin{align*}
\text{The roots of the quadratic equation } x^2 + bx + c = 0 \text{ are } \frac{-b \pm \sqrt{b^2 - 4c}}{2}.
\end{align*}
\begin{align*}
\text{The difference of the roots is } \left| \frac{-b + \sqrt{b^2 - 4c}}{2} - \frac{-b - \sqrt{b^2 - 4c}}{2} \right| = \left| \frac{2\sqrt{b^2 - 4c}}{2} \right| = \left| \sqrt{b^2 - 4c} \right| = |b - 2c|.
\end{align*}
\begin{align*}
\text{Since } |b - 2c| = \left| \sqrt{b^2 - 4c} \right|, \text{ we have } b^2 - 4c = (b - 2c)^2 = b^2 - 4bc + 4c^2.
\end{align*}
\begin{align*}
\text{Simplifying the equation, we get } -4c = -4bc + 4c^2.
\end{align*}
\begin{align*}
\text{Dividing both sides by } -4, \text{ we get } c = bc - c^2.
\end{align*}
\begin{align*}
\text{Rearranging the equation, we get } c^2 - bc + c = 0.
\end{align*}
\begin{align*}
\text{Factoring the equation, we get } c(c - b + 1) = 0.
\end{align*}
\begin{align*}
\text{Since } c \neq 0, \text{ we have } c - b + 1 = 0.
\end{align*}
\begin{align*}
\text{Solving for } c, \text{ we get } c = b - 1.
\end{align*}
\boxed{c = b - 1}

