\boxed{\text{To find the smallest integer value of c such that the function f(x) has a domain of all real numbers, we need to make sure the denominator of the function is never equal to zero.}} 

\text{The denominator of the function is } x^2 + 4x + c. 

\text{To find the values of c that make the denominator zero, we need to solve the equation } x^2 + 4x + c = 0. 

\text{We can use the quadratic formula to solve this equation: } x = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}. 

\text{In this case, a = 1, b = 4, and c is the variable we are trying to find.}

\text{Plugging these values into the quadratic formula, we get: } x = \frac{-4 \pm \sqrt{4^2 - 4(1)(c)}}{2(1)} 

\text{Simplifying the equation, we get: } x = \frac{-4 \pm \sqrt{16 - 4c}}{2} 

\text{For the denominator to be never equal to zero, the expression inside the square root must be greater than zero.}

\text{So, we need to solve the inequality } 16 - 4c > 0. 

\text{Solving for c, we get: } c < \frac{16}{4} 

\text{Simplifying the inequality, we get: } c < 4 

\text{Since c must be an integer, the smallest possible value of c is 3.}

\boxed{3}

