To find the number of drips in a liter of water, we need to know that 1 liter is equal to 1000 milliliters. 

Since 1 drip is equal to $\frac{1}{4}$ of a milliliter, we can find the number of drips in 1 milliliter by taking the reciprocal of $\frac{1}{4}$, which is 4. 

Now, we multiply the number of drips in 1 milliliter by 1000 to find the number of drips in 1 liter.

\begin{align*}
\text{Number of drips in 1 liter} &= \text{Number of drips in 1 milliliter} \times 1000 \\
&= 4 \times 1000 \\
&= 4000
\end{align*}

\boxed{4000}

