\boxed{\text{To find the value of $a$ for which the system of equations has infinitely many solutions, we need to make the two equations equivalent.}}\\
\text{We can do this by multiplying the first equation by 2, so that both equations have the same coefficients for $x$.}\\
\begin{align*}
6x + 4y &= 16,\\
6x &= 2a - 7 - 4y
\end{align*}
\text{Now, we can equate the right-hand sides of the two equations.}\\
\begin{align*}
6x + 4y &= 16,\\
6x &= 2a - 7 - 4y
\end{align*}
\text{Subtracting $6x$ from both sides of the first equation, we get}\\
\begin{align*}
4y &= 16 - 6x,\\
-4y &= -2a + 7 + 6x
\end{align*}
\text{Now, we can add $4y$ to both sides of the second equation.}\\
\begin{align*}
4y &= 16 - 6x,\\
0 &= -2a + 7 + 10x
\end{align*}
\text{Now, we can solve for $a$.}\\
\begin{align*}
0 &= -2a + 7 + 10x,\\
2a &= 7 + 10x,\\
a &= \frac{7 + 10x}{2}
\end{align*}
\text{For the system of equations to have infinitely many solutions, the value of $a$ must be a constant, not a function of $x$.}\\
\text{This means that the coefficient of $x$ in the expression for $a$ must be zero.}\\
\text{Therefore, we set the coefficient of $x$ equal to zero and solve for $a$.}\\
\begin{align*}
10x &= 0,\\
x &= 0
\end{align*}
\text{Substituting $x = 0$ into the expression for $a$, we get}\\
\begin{align*}
a &= \frac{7 + 10(0)}{2},\\
a &= \frac{7}{2}
\end{align*}
\boxed{\frac{7}{2}}

