\text{The graphs intersect when $x^2+a=ax$, which simplifies to $x^2(1-a) = 0$.} 

\text{For the graphs to intersect at exactly one point, the equation $x^2(1-a) = 0$ must have exactly one solution.} 

\text{This happens when $1-a=0$, which gives $a=1$, or when $x^2=0$, which gives $x=0$.} 

\text{However, $x=0$ is not a solution for $a$, so we only consider $a=1$.} 

\text{But we also need to consider the case when the parabola $y=x^2+a$ is a horizontal line, which happens when $a=0$.} 

\text{So, the sum of all numbers $a$ for which the graph of $y=x^2+a$ and the graph of $y=ax$ intersect one time is $1+0=\boxed{1}$.}

