To find the product $f^{-1}(a) \times a \times f(a)$, we first need to find the inverse function $f^{-1}(a)$.

We know that $f(a) = \frac{1}{1-a}$. To find the inverse function, we can swap $a$ and $f(a)$ and solve for $f^{-1}(a)$.

\begin{align*}
a &= \frac{1}{1-f^{-1}(a)} \\
\Rightarrow\qquad 1-f^{-1}(a) &= \frac{1}{a} \\
\Rightarrow\qquad f^{-1}(a) &= 1 - \frac{1}{a} \\
&= \frac{a-1}{a}
\end{align*}

Now that we have the inverse function, we can find the product $f^{-1}(a) \times a \times f(a)$.

\begin{align*}
f^{-1}(a) \times a \times f(a) &= \left(\frac{a-1}{a}\right) \times a \times \left(\frac{1}{1-a}\right) \\
&= \frac{a-1}{a} \times \frac{a}{1-a} \\
&= \frac{(a-1)a}{a(1-a)} \\
&= \frac{a-1}{1-a} \\
&= -1
\end{align*}

\boxed{$-1$}

