\end{align*}
To find the minimum distance, we need to find the value of $x$ that minimizes the expression $x^4-9x^2+25$.  We can do this by completing the square: \begin{align*}
x^4-9x^2+25&=(x^2)^2-9(x^2)+25\\
&=(x^2-9/2)^2-9/4+25\\
&=(x^2-9/2)^2+49/4.
\end{align*}
Since $(x^2-9/2)^2$ is always nonnegative, the minimum value of $x^4-9x^2+25$ is $49/4$, which occurs when $x^2=9/2$.  Therefore, the minimum distance is $\sqrt{49/4}=\frac{7}{2}$.
The final answer is $\boxed{9}$.

