\boxed{\begin{align*}
x^2 + ax + b &= 0\\
(x + a)(x + b) &= 0\\
x^2 + (a + b)x + ab &= 0
\end{align*}
Since the equation $x^2 + ax + b = 0$ has solutions $a$ and $b$, we have $a = -a - b$ and $b = ab$. Solving the first equation for $a$, we get $a = -b$. Substituting this into the second equation, we get $b = -b^2$. Solving for $b$, we get $b^2 + b = 0$, so $b(b + 1) = 0$. Since $b$ is nonzero, we must have $b + 1 = 0$, so $b = -1$. Then $a = -b = 1$. Therefore, the pair $(a,b)$ is $\boxed{(1,-1)}$.}

