\boxed{\text{We have to solve for } n \text{ in the equation } 2(n+1)!+6n!=3(n+1)!.}
\text{We can simplify the equation by expanding the factorials:}
\begin{align*}
2(n+1)!+6n!&=3(n+1)!\\
2(n+1)(n)(n-1)(n-2)\cdots 2\cdot 1+6(n)(n-1)(n-2)\cdots 2\cdot 1&=3(n+1)(n)(n-1)(n-2)\cdots 2\cdot 1
\end{align*}
\text{Dividing both sides by } (n+1)(n)(n-1)(n-2)\cdots 2\cdot 1 \text{, we get:}
\begin{align*}
2(n+1)+6n&=3(n+1)\\
2n+2+6n&=3n+3\\
8n+2&=3n+3\\
5n&=1\\
n&=\frac{1}{5}
\end{align*}
\boxed{\text{The value of } n \text{ is } \frac{1}{5}.}

