First, we can start by getting rid of the absolute value. We know that $|a| \ge b$ is equivalent to $a \ge b$ or $a \le -b$. So, we can split the inequality into two cases:

Case 1: $\frac{3(x + 1)}{x^2 + 2x + 3} \ge 1$

Case 2: $\frac{3(x + 1)}{x^2 + 2x + 3} \le -1$

Now, let's solve each case separately.

\begin{align*}
\text{Case 1: } \frac{3(x + 1)}{x^2 + 2x + 3} &\ge 1 \\
\Rightarrow\qquad 3(x + 1) &\ge x^2 + 2x + 3 \\
\Rightarrow\qquad 0 &\ge x^2 - x + 3 \\
\Rightarrow\qquad 0 &\ge (x - \frac{1}{2})^2 + \frac{7}{4} \\
\Rightarrow\qquad -\frac{7}{4} &\ge (x - \frac{1}{2})^2 \\
\Rightarrow\qquad \sqrt{-\frac{7}{4}} &\ge |x - \frac{1}{2}| \\
\Rightarrow\qquad -\sqrt{\frac{7}{4}} &\le x - \frac{1}{2} \le \sqrt{\frac{7}{4}} \\
\Rightarrow\qquad \frac{1}{2} - \sqrt{\frac{7}{4}} &\le x \le \frac{1}{2} + \sqrt{\frac{7}{4}}
\end{align*}

\begin{align*}
\text{Case 2: } \frac{3(x + 1)}{x^2 + 2x + 3} &\le -1 \\
\Rightarrow\qquad 3(x + 1) &\le -x^2 - 2x - 3 \\
\Rightarrow\qquad 0 &\le -x^2 + x + 3 \\
\Rightarrow\qquad 0 &\le -(x^2 - x - 3) \\
\Rightarrow\qquad 0 &\le -(x - \frac{1}{2})^2 + \frac{7}{4} \\
\Rightarrow\qquad -\frac{7}{4} &\le -(x - \frac{1}{2})^2 \\
\Rightarrow\qquad \sqrt{\frac{7}{4}} &\le |x - \frac{1}{2}| \\
\Rightarrow\qquad \frac{1}{2} - \sqrt{\frac{7}{4}} &\ge x - \frac{1}{2} \ge \sqrt{\frac{7}{4}} \\
\Rightarrow\qquad \frac{1}{2} - \sqrt{\frac{7}{4}} &\ge x \ge \frac{1}{2} - \sqrt{\frac{7}{4}}
\end{align*}

Now, we can combine the two cases to get the final solution.

\begin{align*}
\left| \frac{3(x + 1)}{x^2 + 2x + 3} \right| &\ge 1 \\
\Rightarrow\qquad \frac{1}{2} - \sqrt{\frac{7}{4}} &\le x \le \frac{1}{2} + \sqrt{\frac{7}{4}} \text{ or } \frac{1}{2} - \sqrt{\frac{7}{4}} \ge x \ge \frac{1}{2} - \sqrt{\frac{7}{4}} \\
\Rightarrow\qquad \frac{1}{2} - \sqrt{\frac{7}{4}} &\le x \le \frac{1}{2} + \sqrt{\frac{7}{4}}
\end{align*}

