To solve for $z$, we can start by writing $z$ as $a + bi$, where $a$ and $b$ are real numbers.  Then, we have

\begin{align*}
3z + 4i\bar{z} &= 1 - 8i\\
3(a + bi) + 4i(a - bi) &= 1 - 8i\\
3a + 3bi + 4ai - 4b &= 1 - 8i\\
(3a - 4b) + (3b + 4a)i &= 1 - 8i
\end{align*}

Since the real and imaginary parts must be equal on both sides of the equation, we have

\begin{align*}
3a - 4b &= 1\\
3b + 4a &= -8
\end{align*}

We can solve the first equation for $a$ in terms of $b$:

\begin{align*}
3a &= 1 + 4b\\
a &= \frac{1 + 4b}{3}
\end{align*}

Substituting this into the second equation, we get

\begin{align*}
3b + 4\left(\frac{1 + 4b}{3}\right) &= -8\\
9b + 4 + 16b &= -24\\
25b &= -28\\
b &= -\frac{28}{25}
\end{align*}

Now that we have $b$, we can find $a$:

\begin{align*}
a &= \frac{1 + 4\left(-\frac{28}{25}\right)}{3}\\
a &= \frac{1 - \frac{112}{25}}{3}\\
a &= \frac{\frac{25 - 112}{25}}{3}\\
a &= \frac{-\frac{87}{25}}{3}\\
a &= -\frac{87}{75}\\
a &= -\frac{29}{25}
\end{align*}

Therefore, $z = a + bi = -\frac{29}{25} - \frac{28}{25}i$.

