\boxed{
Let's say the width of the original garden is $w$. Then the length is $2w$. The perimeter of the original garden is $2w + 2(2w) = 6w$. When the dimensions are doubled, the new width is $2w$ and the new length is $4w$. The perimeter of the new garden is $2(2w) + 2(4w) = 12w$. Since the perimeter is doubled, we have $12w = 2(6w)$, which is true. The new garden is a square, so the length and width are equal. We know the area of the new garden is 3600 square feet, so we have $2w \times 4w = 3600$. This simplifies to $8w^2 = 3600$. Dividing both sides by 8, we get $w^2 = 450$. Taking the square root of both sides, we get $w = \sqrt{450} = 15\sqrt{2}$. The original width is $w = 15\sqrt{2}$, so the original length is $2w = 30\sqrt{2}$. The area of the original garden is $w \times 2w = 30\sqrt{2} \times 15\sqrt{2} = 30 \times 15 \times 2 = 900$ square feet.
}

