\begin{array}{rcl}
\text{So, the reflection of the point (3,6,15) across line L is}\\
2\text{proj}_{\vec{d}}\vec{v} - \vec{v} = 2 \begin{pmatrix} -4 \\ -2 \\ 4 \end{pmatrix} - \begin{pmatrix} 3 \\ 6 \\ 15 \end{pmatrix} = \begin{pmatrix} -8 \\ -4 \\ 8 \end{pmatrix} - \begin{pmatrix} 3 \\ 6 \\ 15 \end{pmatrix} = \begin{pmatrix} -8-3 \\ -4-6 \\ 8-15 \end{pmatrix} = \begin{pmatrix} -11 \\ -10 \\ -7 \end{pmatrix}.\end{array}
